Een vreemde, buitenaardse levensvorm stort neer op de enige toegangsweg naar een klein dorpje. Sheriff Annie 
(Emmanuelle Vaugier) wordt belast met het onderzoek. Een gruwelijk en zeer dodelijk wezen zaait al snel paniek in het kleine 
dorpje.
